// SPDX-License-Identifier: MIT
pragma solidity 0.8.26;

import "../Ownable.sol";

contract AllocationWallet is Ownable {

    constructor(address bankContractAddress, address ownerBankAccount) Ownable(ownerBankAccount) {
        bankContract = payable (bankContractAddress);
    }

    address payable private bankContract;

    struct WalletAddressData {
        mapping (address => uint256) allocateAddresses;
        mapping (address => bool) addWalletAddresses;
        uint256 totalAllocatedBalance;
    }
    WalletAddressData private walletData;

    event NewAddressAddedToWallet(address indexed newAddress);
    event AmountAllocatedToWallet(address indexed allocatedAddress, uint256 amount);

    function addNewAddress(address newAddress) external onlyOwner {
        if (newAddress == address(0)) {
            _checkAddress(newAddress);
        } else {
            require(!walletData.addWalletAddresses[newAddress], "Address already added.");

            walletData.addWalletAddresses[newAddress] = true;
            emit NewAddressAddedToWallet(newAddress);
        }
    }

    function walletHasAddress(address walletAddress) external view returns (bool) {
        return walletData.addWalletAddresses[walletAddress];
    }

    function allocateAmountToWalletAddress(address walletAddress, uint256 amount) external onlyOwner {
        require(walletData.addWalletAddresses[walletAddress], "Address not in wallet, add address to wallet.");
        require(amount > 0, "Invalid amount value.");

        uint256 amountInEther = amount * 1 ether;
        require(_checkIfBankBalanceIsSufficient(amountInEther), "Insufficient balance in bank account.");

        walletData.allocateAddresses[walletAddress] += amountInEther;
        walletData.totalAllocatedBalance += amountInEther;
        emit AmountAllocatedToWallet({allocatedAddress: walletAddress, amount: amountInEther});
    }

    function _checkIfBankBalanceIsSufficient(uint256 amountInEther) private view onlyOwner returns (bool) {
        return bankContract.balance > (walletData.totalAllocatedBalance + amountInEther);
    }

    function justToCheckBankBalance() external view returns (uint) {
        return bankContract.balance;
    }
}

