// SPDX-License-Identifier: MIT
pragma solidity 0.8.26;

abstract contract Ownable {

    address private owner;

    event OwnerShipChangedTo(address indexed oldOwnerAddress, address indexed newOwnerAddress, uint timeStamp);

    error InvalidAddress(address sentAddress, string errorMsg);

    constructor (address creatorAddress) {
        _checkAddress(creatorAddress);
        _transferOwnership(creatorAddress);
    } 

    modifier onlyOwner() {
        require(owner == msg.sender, "You are not the owner, you are not allowed.");
        _;
    }

    function transferOwnership(address newOwner) external virtual onlyOwner {
        _checkAddress(newOwner);
        _transferOwnership(newOwner);
    }

    function _transferOwnership(address newOwner) internal {
        address oldOwner = owner;
        owner = newOwner;

        emit OwnerShipChangedTo({oldOwnerAddress: oldOwner, newOwnerAddress: newOwner, timeStamp: block.timestamp});
    }

    function _msgOwner() internal view returns (address) {
        return owner;
    }

    function _checkAddress(address sender) internal pure {
        // if empty address or 0x000 address was sent
        if (sender == address(0)) {
            revert InvalidAddress({sentAddress: sender, errorMsg: "Invalid address."});
        }
    }
}

